
<!DOCTYPE html>

<html lang="ru">
<head>
<meta charset="utf-8"/>
<meta content="width=device-width, initial-scale=1.0" name="viewport"/>
<title>Litcash Neo</title>
<style>
body {
  font-family: Arial, Helvetica, sans-serif;
  background: linear-gradient(-45deg, #2b001f, #0b1a40, #4fc3f7 5%, #0b1a40, #2b001f);
  background-size: 400% 400%;
  animation: breathingGradient 15s ease-in-out infinite;
  color: white;
  margin: 0;
  padding: 20px;
}
@keyframes breathingGradient {
  0% { background-position: 0% 50%; }
  50% { background-position: 100% 50%; }
  100% { background-position: 0% 50%; }
}

* {
      box-sizing: border-box;
      margin: 0;
      padding: 0;}
.card {
      background: rgba(20, 20, 40, 0.9);
      border-radius: 18px;
      padding: 20px;
      margin-bottom: 20px;
      box-shadow: 0 0 20px rgba(0, 255, 255, 0.2);
      transition: transform 0.3s;}
.card:hover {
      transform: translateY(-5px);}
.card h2 {
      font-size: 20px;
      margin-bottom: 12px;
      color: #00eaff;}
.button {
      display: inline-block;
      background: #00eaff;
      color: #000;
      padding: 10px 20px;
      border-radius: 50px;
      font-weight: bold;
      text-decoration: none;
      transition: 0.2s;}
.button:hover {
      background: #00c3cc;}
.grid {
      display: grid;
      gap: 16px;}
@media (min-width: 768px) {
      .grid {
        grid-template-columns: 1fr 1fr;}
}
.footer {
      text-align: center;
      font-size: 13px;
      margin-top: 40px;
      color: #777;}
.circle-card {
  width: 280px;
  height: 280px;
  background: rgba(20, 20, 40, 0.9);
  border-radius: 50%;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  text-align: center;
  box-shadow: 0 0 30px rgba(0, 255, 255, 0.3);
  margin: 20px auto;}
.circle-card h2 {
  font-size: 20px;
  color: white;
  margin-bottom: 15px;}
.circle-card .button {
  display: inline-block;
  background: #1e88e5;
  color: white;
  padding: 12px 24px;
  border-radius: 30px;
  text-decoration: none;
  font-weight: bold;
  font-size: 16px;
  transition: background 0.3s;}
.circle-card .button:hover {
  background: #1565c0;}
.referral-chart {
  display: flex;
  justify-content: space-around;
  align-items: flex-end;
  height: 150px;
  margin-top: 20px;}
.referral-chart .bar {
  width: 30%;
  background: linear-gradient(0deg, #00eaff, #1e88e5);
  border-radius: 10px 10px 0 0;
  color: white;
  display: flex;
  align-items: flex-end;
  justify-content: center;
  padding: 5px;
  font-size: 12px;
  box-shadow: 0 0 15px rgba(0, 255, 255, 0.4);}
.header {
  width: 100%;
  margin-bottom: 20px;}
.logo {
  color: #00eaff;
  text-decoration: none;
  font-size: 24px;
  font-weight: bold;
  cursor: pointer;}
.levels-container {
  display: flex;
  justify-content: space-around;
  flex-wrap: wrap;
  margin-top: 15px;}
.level {
  background: linear-gradient(45deg, #1e88e5, #00eaff);
  color: white;
  padding: 8px 16px;
  border-radius: 20px;
  box-shadow: 0 0 10px rgba(0, 255, 255, 0.5);
  margin: 5px;
  font-size: 14px;
  transition: transform 0.3s;
  cursor: pointer;}
.level:hover {
  transform: translateY(-5px);}
.header {
  display: flex;
  justify-content: space-between;
  align-items: center;}
.header-buttons button {
  background: rgba(30, 136, 229, 0.8);
  color: white;
  border: none;
  padding: 8px 14px;
  border-radius: 20px;
  margin-left: 6px;
  cursor: pointer;
  transition: background 0.3s, box-shadow 0.3s;}
.header-buttons button:hover {
  background: rgba(30, 136, 229, 1);
  box-shadow: 0 0 15px rgba(0, 255, 255, 0.5);}
@media (max-width: 768px) {
  .header {
    flex-direction: column;
    align-items: flex-start;}
.header-buttons {
    margin-top: 10px;
    width: 100%;
    display: flex;
    flex-wrap: wrap;
    justify-content: center;}
.header-buttons button {
    flex: 1 1 auto;
    margin: 4px;
    font-size: 14px;
    padding: 6px 10px;}
}
.card, .card * {
  color: white !important;}
.button {
  display: inline-block;
  width: 120px;      /* Uniform width for all buttons */
  text-align: center; 
  padding: 10px 0;   /* Vertical padding, horizontal auto-adjust */
  box-sizing: border-box;}
@keyframes breathingGradient {
  0% { background-position: 0% 50%;}
50% { background-position: 100% 50%;}
100% { background-position: 0% 50%;}
}
}
.container {
  max-width: 1100px !important;
  margin-left: auto !important;
  margin-right: auto !important;
  padding: 20px;
  box-sizing: border-box;
  width: 100%;
}
@media (max-width: 1200px) {
  .container {
    max-width: 98vw !important;
    padding: 10px;
  }
}
@media (max-width: 800px) {
  .container {
    max-width: 100vw !important;
    padding: 4px;
  }
}
</style>
<style>
body {
  background: linear-gradient(-45deg, #121212, #1e1e1e, #121212, #1e1e1e);
  background-size: 400% 400%;
  animation: gradientFlow 20s ease infinite;
  transition: background 0.4s ease;
}
.light-mode {
  background: linear-gradient(-45deg, #f5f5f5, #e8e8e8, #f5f5f5, #e8e8e8);
  color: #111;
}
.light-mode .card {
  background: white;
  color: #111;
}
@keyframes gradientFlow {
  0% { background-position: 0% 50%; }
  50% { background-position: 100% 50%; }
  100% { background-position: 0% 50%; }
}
.card, button {
  animation: fadeIn 0.6s ease-in;
  transition: transform 0.2s ease, box-shadow 0.2s ease;
}
.card:hover {
  transform: translateY(-4px);
  box-shadow: 0 6px 20px rgba(0,0,0,0.1);
}
@keyframes fadeIn {
  from { opacity: 0; transform: translateY(10px); }
  to { opacity: 1; transform: translateY(0); }
}

    logoutBtn.addEventListener("click", () => {
      localStorage.clear();
      window.location.href = "index.html";
    });
  }
});
</script>

<script>
  document.addEventListener("click", function(e) {
    const menu = document.getElementById("lang-menu");
    const btn = document.getElementById("lang-btn");
    if (btn && btn.contains(e.target)) {
      menu.style.display = menu.style.display === "block" ? "none" : "block";
    } else {
      if (menu) menu.style.display = "none";
    }
  });
</script>

function changeLanguage(lang) {
  localStorage.setItem("lang", lang);
  document.querySelectorAll("[data-i18n]").forEach(el => {
    const key = el.getAttribute("data-i18n");
    if (translations[lang] && translations[lang][key]) {
      el.textContent = translations[lang][key];
    }
  });
}

document.querySelectorAll("#lang-menu a").forEach(link => {
  link.addEventListener("click", (e) => {
    e.preventDefault();
    const lang = link.textContent.trim().slice(-2).toLowerCase(); // ru, en, etc.
    changeLanguage(lang);
  });
});

document.addEventListener("DOMContentLoaded", () => {
  const savedLang = localStorage.getItem("lang") || "en";
  changeLanguage(savedLang);
});
